# This script calculates CWM trait values and the taxon level trait estimates (Appendix S7)
# Annegreet Veeken
# code references:
# http://doingbayesiandataanalysis.blogspot.com/2017/06/bayesian-estimation-of-correlations-and.html#comment-form
# http://mmeredith.net/blog/2020/Correlated_priors.htm
# JAGS user manual

## Load packages
library(tidyverse)
library(rjags)
library(runjags)
library(mcmc)
library(coda)

## Load and prepare data ----
# Species per pollen type list
spec <- readRDS("RDS_files/01_PollenType_species.rds") %>% 
  as_tibble()

# filter out aquatic species
spec <- spec %>% 
  filter(StdValue < 10 | is.na(StdValue)) 
spec$pollentaxon[spec$pollentaxon == "Sambucus nigra"] <- "Sambucus.nigra"
spec <- spec %>% 
  dplyr::select(stand.spec, pollentaxon) %>% 
  filter(!pollentaxon == "NA" & !is.na(stand.spec)) %>% 
  distinct()

# check for duplicate values (species assigned to two or more pollen type) 
duplicats <- table(spec$stand.spec) %>% 
  data.frame() %>% filter(Freq > 1) 

# Gap-filled trait data
gapdata <- read.csv("C:/Users/lgxgv/OneDrive - The University of Nottingham/Data analysis/PhD/Meta-analysis/Analysis/Data/GapfilledTraitDataFS.csv") 
gapdata <- gapdata %>% 
  mutate(Species = str_replace(Spp, "\\.", " ")) %>% 
  filter(Species %in% spec$stand.spec) # only the relevant species

# merge trait data with spec/pol list
trait <- gapdata %>% 
  inner_join(spec, by = c("Species" = "stand.spec")) %>% 
  arrange(pollentaxon) %>%  # sort alphabetically
  dplyr::select(pollentaxon,PlantHeight,SLA, LA = Area, LDMC, LeafC = CperDryMass, LeafP = P, 
                LeafN = N, Seed.length = SeedLength, Seed.count = SeedNr_reproductonUnit, 
                Seed.mass = SeedMass)
# Pollen data
lPOL <- readRDS("RDS_files/04_PollenWEU-PPEcorrected.rds")

# convert pollen data to data frame
sitenames <- names(lPOL)

pol <-
  purrr::map2(lPOL, sitenames, ~.x %>% 
                ungroup() %>% as.data.frame() %>%
                rename(taxa = ppe.taxon) %>% 
                dplyr::select(age, depth, taxa, adjustedpercent) %>%
                # covert to wide format
                spread(., key = taxa, value = adjustedpercent) %>%
                mutate(age = as.numeric(age),
                       site.name = .y)) %>% # add site.name  
  # bind all data frames in list
  bind_rows() %>%
  # set all pollen not present at a site to zero
  replace(is.na(.), 0) %>% 
  # order columns alphabetically
  dplyr::select(site.name, age, order(colnames(.))) %>% 
  # order rows
  arrange(site.name, age) 

pollentaxa <- pol %>%
  dplyr::select(-site.name, -age) %>%
  colnames(.)

