## JAGS model----
# prepare data
Trait <- trait %>% 
  filter(pollentaxon %in% pollentaxa) %>%
  dplyr::select(SLA,PlantHeight, LA, LDMC, LeafC, LeafP, LeafN, Seed.length, Seed.count, Seed.mass)
Tax <- trait %>%
  filter(pollentaxon %in% pollentaxa) %>%
  pull(pollentaxon) %>% 
  as.factor() 
Ntax <- nlevels(Tax)

# Standardize data
zTrait <- Trait %>% 
  mutate(across(everything(), scale)) %>% 
  as.matrix()

# calculate mean and sd per trait for converting to original scale in JAGS
sdOrig <- Trait %>% apply(., 2, sd)
meanOrig <- Trait %>% apply(., 2, mean)

N <- nrow(Trait) # number of observations
Nvar <- ncol(Trait) # number of traits

# Abundance
Ab <- pol %>%
  dplyr::select(-site.name, -depth, -age) %>%
  as.matrix()
Ntax <- ncol(Ab)
Nyr <- nrow(Ab) 
  
# Parameters for wishart (dwish) (generalizable form of a multidimensional gamma distribution) prior on inverse covariance matrix:
zRscal <- rep(ncol(zTrait) + 1, Ntax) # setting the df of the wishart distribution will give uniform prior on the correlation parameters https://sourceforge.net/p/mcmc-jags/discussion/610037/thread/eab372de/?limit=25#1714 
zRmat <- array(diag(x = 100, nrow = ncol(zTrait)), 
               c(Nvar, Nvar, Ntax))  # Rmat = diag(apply(y,2,var))

## JAGS code
mod <- "model {
## Pollen taxonomic level
# Likelihood
for (i in 1:N) {
      zTrait[i, 1:Nvar] ~ dmnorm(zMu[Tax[i], 1:Nvar], zInvCovMat[1:Nvar, 1:Nvar, Tax[i]])
}

# Priors
for(taxID in 1:Ntax){
    for(varID in 1:Nvar){
      zMu[taxID, varID] ~ dnorm(0, 10^-4)
    }
  zInvCovMat[1:Nvar, 1:Nvar, taxID] ~ dwish(zRmat[1:Nvar, 1:Nvar, taxID], zRscal[taxID])
}
  
# Convert taxon mean and sd to original scale:
# Convert invCovMat to sd
for(taxID in 1:Ntax){
zCovMat[1:Nvar, 1:Nvar, taxID] <- inverse(zInvCovMat[1:Nvar, 1:Nvar, taxID])
  for (varID in 1:Nvar ) {
    zSigma[taxID, varID] <- sqrt(zCovMat[varID, varID, taxID])
  }
}

for (taxID in 1:Ntax){
  for (varID in 1:Nvar) {
    sigma[taxID, varID] <- zSigma[taxID,varID] * sdOrig[varID]
    mu[taxID, varID] <- zMu[taxID, varID] * sdOrig[varID] + meanOrig[varID]
  }
}

## Community level
for (i in 1:Nyr){
    zCWM[i,1:Nvar] ~ dmnorm(zMu[r[i],1:Nvar], zInvCovMat[1:Nvar, 1:Nvar, r[i]])
    r[i] ~ dcat(Ab[i, 1:Ntax])
}

# Convert cwm to original scale
for (i in 1:Nyr){
    for (varID in 1:Nvar) {
    CWM[i,varID] <- zCWM[i,varID] * sdOrig[varID] +
                           meanOrig[varID]
    }
}

#data# N, Nvar, zTrait, zRmat, zRscal, Tax, Ntax, sdOrig, meanOrig, Ab, Nyr
#monitor# mu, sigma, CWM
#inits# zMu
}"


# Initial values
mintrait <- apply(Trait, 2, min)
maxtrait <- apply(Trait, 2, max)
zMu <- list(chain1 = as.matrix(as.data.frame(lapply(mintrait,rep, Ntax))),
            chain2 = as.matrix(as.data.frame(lapply(maxtrait,rep, Ntax))))
zInvCovMat <- list(chain1 = as.matrix(rep(0,Ntax)),
                   chain2 = as.matrix(rep(1,Ntax)))
# Run the model
results <- run.jags(mod, n.chains = 2,
                    sample = 1000, thin = 10)

saveRDS(results, paste0("RDS_files/05_multivariate_runjags.rds"))

# Check convergence
# trace plots
plot(results, vars = c("CWM[1000,1]","CWM[1000,2]","CWM[1000,3]","CWM[1000,4]","CWM[1000,5]","CWM[1000,6]","CWM[1000,7]","CWM[1000,8]","CWM[1000,9]","CWM[1000,10]",
                       "CWM[5000,1]","CWM[5000,2]","CWM[5000,3]","CWM[5000,4]","CWM[5000,5]","CWM[5000,6]","CWM[5000,7]","CWM[5000,8]","CWM[5000,9]","CWM[5000,10]",
                       "CWM[7000,1]","CWM[7000,2]","CWM[7000,3]","CWM[7000,4]","CWM[7000,5]","CWM[7000,6]","CWM[7000,7]","CWM[7000,8]","CWM[7000,9]","CWM[7000,10]"),
     file = paste0("Convergence_diag_multivariate.pdf"))
# gelman plots
mcmc_sel <- mcmc.list(results[["mcmc"]][[1]][,c(1000, 8427, 15854, 23281,30708, 38135, 45562, 52989, 60416, 67843,
                                                5000, 12427, 19854, 27281, 34708, 42135, 49562, 56989, 64416, 71843,
                                                7000, 14427, 21854, 29281, 36708, 44135, 51562, 58989, 66416, 73843)], 
                      results[["mcmc"]][[2]][,c(1000, 8427, 15854, 23281,30708, 38135, 45562, 52989, 60416, 67843,
                                                5000, 12427, 19854, 27281, 34708, 42135, 49562, 56989, 64416, 71843,
                                                7000, 14427, 21854, 29281, 36708, 44135, 51562, 58989, 66416, 73843)])
pdf(paste0("Convergence_diag_gelman_multivariate.pdf"))
gelman.plot(mcmc_sel, ask = FALSE)
dev.off()
}


