# Load and prepare data
files <- list.files("RDS_files/") %>%
  str_subset("05_multivariate_trait_") %>% 
  str_subset("PH", negate = TRUE) 
files

folderpath.fun <- function(x)
{paste("RDS_files", x, sep = "/")}

dfCWM <- files %>% 
  folderpath.fun(.) %>% 
  purrr::map(~readRDS(.) %>% 
               as.data.frame) %>% 
  bind_rows() %>% 
  rownames_to_column("parameter") %>%
  filter(str_detect(parameter, "CWM")) %>%
  dplyr::select(parameter, Mean, SD) %>%
  mutate(ID = str_extract(parameter, pattern = "\\[(.*?)\\,") %>% 
           str_remove_all(pattern = "[[:punct:]]") %>% 
           as.numeric(),
         trait = str_extract(parameter, pattern = "\\,(.*?)\\]") %>% 
           str_remove_all(pattern = "[[:punct:]]") %>% 
           as.factor() %>% 
           recode("1" = "SLA", 
                  "2" = "PlantHeight",
                  "3" = "LA", 
                  "4" = "LDMC",
                  "5" = "LeafC",
                  "6" = "LeafP",
                  "7" = "LeafN",
                  "8" = "Seed.length",
                  "9" = "Seed.count",
                  "10" = "Seed.mass")) 

lab <- pol %>% 
  dplyr::select(site.name, age, depth) %>% 
  mutate(ID = seq(1:nrow(.)),
         site.name = as.factor(site.name))

# CHECK availability of all id's before merge
polid <- lab %>% 
  pull(ID) %>% 
  unique()
cwmid <- dfCWM %>% 
  pull(ID) %>% 
  unique()

dfCWM <- dfCWM %>% 
  left_join(lab, by = "ID")

saveRDS(dfCWM, paste0("RDS_files/05_multivariate_CWM_100.rds"))


